import { NavLink } from 'react-router-dom';
import './styles.css';

const Navbar = () => {
  return (
    <nav className="admin-nav-container">
      <ul>
        <li>
                   <NavLink className={(navData) => navData.isActive ? "active" : "" } to="/admin/products" className="admin-nav-item active"></NavLink>
        </li>
        <li>
          <a href="link" className="admin-nav-item">
            <p>Categorias</p>
          </a>
        </li>
        <li>
          <a href="link" className="admin-nav-item">
            <p>Usuarios</p>
          </a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
